        return new Source("{% extends 'layout/admin.html.twig' %}

{% block title %}List of Links{% endblock %}

{% block body %}
    <h1>List of Links</h1>

    <ul>
        {% for link in links %}
            <li class=\"row\">
                <strong class=\"col-md-6\">{{ link.getTitle() }}</strong> <strong class=\"col-md-4\">- {{ link.getLink() | slice(0, 30) }}...</strong>
                {% if link.getFileName() %}
                    <strong class=\"col-md-2\">
                        <a href=\"{{ link.getFullAttachmentPath() }}\" target=\"_blank\">Download Attachment</a>
                    </strong>
                {% else %}
                    <strong class=\"col-md-2\">
                        No Attachment
                    </strong>
                {% endif %}
            </li>
        {% endfor %}
    </ul>
{% endblock %}
", "admin/link/list_links.html.twig", "C:\\xampp\\htdocs\\Symfony\\mediamaps\\templates\\admin\\link\\list_links.html.twig");
